import { Layout } from "../../../components/Layout";
import fetch from "isomorphic-unfetch";
import { useRouter } from "next/router";

const Component = () => {
  const {
    query: { dynamic }
  } = useRouter();

  return (
    <Layout>
      <div>
        <h1>Dynamic Route</h1>
        <br />
        <div>{JSON.stringify(dynamic)}</div>
      </div>
    </Layout>
  );
};

